INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(31, 'Xixi', 'Yorkshire', 2, 'Femelle', 'Chien', 'Saint-Maur-des-Fossés', 'Non', '\r\nXixi, une douce chienne au pelage mêlant des teintes de caramel, porte sur ses yeux empreints de tristesse le poids de l\'abandon. Après que ses fidèles compagnons humains aient déménagé, Xixi se retrouve seule, cherchant un nouvel amour dans le regard attentionné d\'une famille prête à partager son monde avec cette compagne fidèle en quête d\'un foyer chaleureux.', '', 'Non', 'Non', 'Non', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(32, 'Fly', 'Croisé', 14, 'Male', 'Chien', 'Créteil', 'Oui', '\r\nFly, vieux compagnon au pelage gris, a été laissé de côté à cause de son âge. Malgré cela, il respire la tranquillité. En quête d\'une fin de vie paisible, il recherche un chez-soi où le calme règne, prêt à partager ses jours avec une famille aimante qui apprécie la douceur d\'une retraite bien méritée.', '', 'Non', 'Non', 'Non', 'Non');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(33, 'Loki', 'Croisé', 3, 'Male', 'Chien', 'Créteil', 'Non', '\r\nLoki, un chien au charme puissant, porte sur ses épaules l\'histoire d\'un abandon lié à sa force apparente envers d\'autres chiens. Pourtant, derrière sa stature imposante, réside un cœur tendre qui a grandi aux côtés d\'une enfant, partageant les moments doux de la petite de 0 à 3 ans. À la recherche d\'un nouveau foyer qui comprendra sa nature protectrice et lui offrira l\'amour et la compréhension qu\'il mérite, Loki attend patiemment une seconde chance pour illuminer la vie d\'une famille.', '', 'Non', 'Non', 'Non', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(34, 'Snoop', 'Croisé', 2, 'Male', 'Chien', 'Chilleurs-Aux-Bois', 'Non', 'Snoop est un très gentil chien trouvé dans la rue et que personne n\'a réclamé. Gentil avec tout le monde au refuge, sociable avec les autres chiens, Snoop fera le bonheur de toute la famille. Son éducation sera à parfaire, mais il semble être facile à vivre et s\'adaptera facilement à son nouvel environnement, si tant est que vous avez du temps à lui accorder bien sûr!', '', 'Non', 'Oui', 'Oui', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(35, 'Mitro', 'Croisé', 2, 'Male', 'Chien', 'Orgeval', 'Non', 'Mitro est un loulou très attachant. Ultra sensible, il aura besoin de temps et de beaucoup d\'amour pour prendre confiance et réussir à canaliser ses émotions. C\'est un chien facilement \"lisible\" et qui laisse passer beaucoup d\'informations par le regard. Confiance et complicité seront les maitres mots pour en faire un chien bien dans ses pattes.\r\nMitro pourra facilement partager ses balades avec des copains après présentation.\r\nNous privilégierons un placement dans un environnement calme, sans jeunes enfants. Son éducation sera à poursuivre en positif exclusivement.\r\nMitro s\'attache très vite à tous ceux qui s\'occupent de lui et à besoin de repères pour continuer à évoluer. Nous espérons donc qu\'il trouvera bientôt une famille, pour la vie.', '', 'Non', 'Oui', 'Non', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(36, 'Jackson', 'Labrador', 11, 'Male', 'Chien', 'Vaux-Le-Penil', 'Oui', 'Jackson est un chien sensible qui vient d\'un élevage, récupéré par la fourrière, il a malheureusement des signes de maltraitance ... Il a connu 6 foyers et 6 abandons ... Jackson perd confiance en l\'Humain au fil des retours chez nous ... Il faudra donc plusieurs visites avant qu\'il vous accorde sa confiance. Il n\'est pas de ceux qui aime les longs câlin, il préfèrera les longues balades au calme.\r\nSon soucis ? Il est très gourmand et n\'aime pas partager ses affaires. Comment lui en vouloir ? Lui qui ne sait plus l\'intention de l\'Humain après autant de retours.\r\n\r\nJackson a besoin d\'un foyer sans enfant et sans autres animaux, avec des personnes douces, patientes et cohérentes dans son éducation; bien qu\'il ait déjà des bases, il faudra la poursuivre.\r\n\r\nPour le bien-être de Jackson, merci de vous renseigner sur les signaux d\'apaisements et sur l\'éducation bienveillante.', '', 'Non', 'Non', 'Non', 'Non');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(37, 'Nillup', 'Cane Corso', 6, 'Femelle', 'Chien', 'Compiègne', 'Non', 'Nillup est une cane corso, née en 2017, arrivée par le biais de la fourrière, Nillup présentais une fracture. Elle a donc été opérée. Après de longues semaines de convalescence, elle peut rejoindre une nouvelle famille.\r\n\r\nNillup est une chienne calme, tranquille et affectueuse. Elle pourra vivre avec des grands enfants respectueux et en maison ou appartement.\r\n\r\nElle s’entend avec les chiens et les chats.', '', 'Non', 'Oui', 'Oui', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(38, 'Thanos', 'Croisé', 4, 'Male', 'Chien', 'Plaisir', 'Non', 'Thanos est un grand gabarit doux calme et câlin mais qui reste très puissant.\r\nil aime son confort\r\ntres intelligent .\r\nIl devra être placé sans animaux dans un pavillon au calme et en campagne.\r\n', '', 'Oui', 'Non', 'Non', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(39, 'Salami', 'Croisé', 10, 'Male', 'Chien', 'Plaisir', 'Oui', 'Salami est un petit chien très dynamique.\r\nIl n\'est pas compatible chats, chiens et enfants en bas âge.\r\nIl aura besoin d\'une maison avec jardin.\r\nIl adore les balades.\r\nC\'est un chien très propre par contre il a beaucoup de caractère. Quand il ne veut pas quelque chose, il vous le fais savoir. Par exemple, il aime être caressé mais n’aime pas les câlins trop rapprochés, pour faire simple, il n\'est pas fan d’être manipulé. S\'il veut du contact, il faut le laisser venir vers vous et quand il en a marre, il faut le laisser tranquille et ne pas insister.\r\nIl a aussi un caractère dominant et territorial. S\'il a un jouet, c’est interdit de lui prendre.', '', 'Non', 'Non', 'Non', 'Non');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(40, 'Jaya', 'Européen', 12, 'Femelle', 'Chat', 'Compiègne', 'Oui', 'Très gentille et câline, Jaya est d\'un tempérament calme.\r\nElle est sociable avec les autres chats et elle pourra vivre avec des enfants.', '', 'Non', 'Oui', 'Non', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(41, 'Chili', 'Européen', 5, 'Femelle', 'Chat', 'Vaux-Le-Penil', 'Oui', 'Chili est une chatte FIV +,très peureuse, elle aura besoin de temps pour accorder sa confiance. Elle devra vivre en appartement sans accès extérieur (jardin) et sans autres chats non FIV+.\r\nEn double adoption obligatoire avec Sinatra.', '', 'Non', 'Non', 'Oui', 'Oui');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(42, 'Everdeen', 'Européen', 13, 'Femelle', 'Chat', 'Chamarande', 'Oui', 'Everdeen nous arrive de fourrière animale, c\'est une minette caline mais qui apprecie sa tranquillitée.\r\nTrès calme elle pourra vivre en appartement ou en maison sans accès à l\'extérieur. Nous ne connaissons pas ses ententes avec les chiens ni ses congénères.\r\nEverdeen est hyperthyroïdienne et a un souffle cardiaque ( prix des comprimés environ 50 euro par mois hors alimentation et suivi vétérinaire) Elle à une alimentation urinary.', '', 'Non', 'Non', 'Non', 'Non');
INSERT INTO `pets` (`id`, `name`, `breed`, `age`, `genre`, `type`, `localisation`, `urgent`, `description`, `img`, `house`, `dog`, `cat`, `kids`) VALUES
(43, 'Erable', 'Européen', 2, 'Male', 'Chat', 'Compiègne', 'Oui', 'FIV+\r\nErable est un matou calme et très discret. Encore timide vis à vis de l\'humain, il aura besoin d\'une famille patiente qui lui laissera du temps afin qu\'il se sente bien dans son nouvel environnement.\r\nErable ne sera pas placé en présence de chiens et d\'enfants. Mais il pourra vivre avec un autre chat calme (FIV+ aussi)', '', 'Non', 'Non', 'Oui', 'Non');

